#include "base58.h"

#include <stdlib.h>
#include <stdio.h>


const char *feature = "";

uint8_t binbuf[512];

int main(){
    ssize_t olen;
    size_t  blen = 512;
    float *f;

    olen = base58_decode(feature, strlen(feature), binbuf, blen);
    if(olen > 0){

        printf("base58 to bin ok :%d  %d\n", strlen(feature), olen);

        f = (float *)binbuf;
        for(int i = 0; i < 10; i++){
            printf("bin %d -> %f\n", i, f[i]);
        }
    
        return 0;

    }else{
        printf("base58 to bin fail %d %d\n", strlen(feature), olen);
        return -1;
    }
}

